import React from "react";

class ProfileStatus extends React.Component {

    state = {
        editMode:true
    }

    render() {
        return (<div>
            Profile status:
            {this.props.editMode?true:<input/>}
            <span>{this.props.status}</span><br></br>

            <input value={this.props.status}/>
        </div>)
    }
}

export default ProfileStatus;
